webpackJsonp([96801168001813],{1193:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Psyked.co.uk",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/cool-stuff-in-google-image-details/index.md absPath of file >>> MarkdownRemark",html:'<p><img src="/content/images/2011/07/google-plus-image-shot.png" alt="A screenshot of the Google+ Image details panel" title="Google+ Image Details"> </p>\n<p>There are of course many cool things in <a href="http://plus.google.com" title="Open Google+ in a new Window.">Google+</a>, but here\'s one that piqued my interest on the Geek-factor. </p>\n<p>When you upload images to Google+ it goes to the trouble of extracting the images\' metadata and producing an histogram of the image data - as shown in the screenshot above. I\'d guess there\'s more on the way, judging from the tab-style interface that currently exists. </p>\n<p>If this sort of stuff interests you, you might like to check out some of the Flash-based histogram and image metadata projects that already exist - the <a href="http://je2050.joa-ebert.com/imageprocessing/de/popforge/imageprocessing/core/Histogram.html" title="Open the class reference for the Histogram class in a new Window">Histogram</a> class of Joa Eberts\' Imageprocessing Library for histograms [<a href="http://blog.joa-ebert.com/imageprocessing-library/" title="Open Joa Eberts&#x27; Imageprocessing Library in a new Window.">link</a>] and on image metadata the <a href="http://zaalabs.com/2010/07/finding-celebrity-locations-via-twitter/" title="Finding celebrity locations via Twitter — Celebrity Exif data mining">"Finding celebrity locations via Twitter — Celebrity Exif data mining"</a> post from nate of ZaaLabs.</p>',frontmatter:{title:"Cool stuff in Google+ - Image details",date:"July 17, 2011",tags:["image-processing"]}}},pathContext:{}}}});
